import { useState } from "react";


function Details(){
    const [details,setDetails]=useState()
    const useEffect=()=>{
        fetch("http://localhost:3009/seconddata")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                setDetails(resp)
                console.log(resp)
            })
    }

    return(
        <div>
            <h2>data details</h2>
        </div>
    )
}
export default Details;
